import React from 'react'

export default (props) =>{
    const employees = props.employees;
    const employeeDropdown = employees.map((emplyee) =>
        <option value={emplyee}>emplyee</option>
    );
    return(
        <>
        <h3>Employee Dropdown</h3>
        <label for="availalbe employees">Select an Emplyee</label>
        <select id={employeeDropdown}>
            <option >{employeeDropdown}</option>
        </select>
        </>
    );
};
